import { Component } from '@angular/core';
import { AuthService } from '../auth.service';
import { NotificationService } from 'src/app/services/notification.service';
import { Router } from '@angular/router';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent {
  public signupForm!: FormGroup;
  public loading = false;

  // public user = { 
  //   username: '', 
  //   fullName: '', 
  //   email: '', 
  //   mobile: '', 
  //   password: '',
  //   addressLine1: '',
  //   addressLine2: '',
  //   city: '',
  //   state: '',
  //   postalCode: '',
  //   country: ''
  // };

  constructor(
    public formBuilder: FormBuilder,
    public authService: AuthService,
    public notificationService: NotificationService,
    public router: Router
  ){}

  ngOnInit(){
    this.signupForm = this.formBuilder.group({
      username: ['', Validators.required], 
      fullName: ['', Validators.required], 
      email: ['', Validators.required], 
      mobile: ['', Validators.required], 
      password: ['', Validators.required],
      addressLine1: ['', Validators.required],
      addressLine2: ['', Validators.required],
      city: ['', Validators.required],
      state: ['', Validators.required],
      postalCode: ['', Validators.required],
      country: ['', Validators.required]
    })
  }

  // public signup(){
  //   this.authService.signup(this.user).subscribe(
  //     response => {
  //       this.notificationService.showSuccess('Sign up successful');
  //       console.log('Sign up successful', response);
  //       this.router.navigate(['/login']);
  //     },
  //     error => {
  //       this.notificationService.showError('Sign up failed: ' + error.error.message);
  //       console.error('Sign up failed', error);
  //     }
  //   );
  // }

  public onSubmit(){
    if (this.signupForm.invalid){
      return;
    }
    this.loading = true;
    this.authService.signup(this.signupForm.value).subscribe(
      response => {
        this.notificationService.showSuccess('Sign up successful');
        console.log('Sign up successful', response);
        this.router.navigate(['/login']);
      },
      error => {
        this.notificationService.showError('Sign up failed: ' + error.error.message);
        console.error('Sign up failed', error);
        this.loading = false;
      }
    )
  }
}
<h1>Sign Up</h1>
<form [formGroup]="signupForm" (ngSubmit)="onSubmit()" class="login-form">
  <mat-form-field appearance="fill">
    <mat-label>Username</mat-label>
    <input matInput formControlName="username" type="text" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Full Name</mat-label>
    <input matInput formControlName="fullName" type="text" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Email</mat-label>
    <input matInput formControlName="email" type="email" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Mobile</mat-label>
    <input matInput formControlName="mobile" type="text" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Password</mat-label>
    <input matInput formControlName="password" type="password" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Address Line 1</mat-label>
    <textarea matInput formControlName="addressLine1" required></textarea>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Address Line 2</mat-label>
    <textarea matInput formControlName="addressLine2"></textarea>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>City</mat-label>
    <input matInput formControlName="city" type="text" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>State</mat-label>
    <input matInput formControlName="state" type="text" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Postal Code</mat-label>
    <input matInput formControlName="postalCode" type="text" required>
  </mat-form-field>

  <mat-form-field appearance="fill">
    <mat-label>Country</mat-label>
    <input matInput formControlName="country" type="text" required>
  </mat-form-field>

  <button mat-raised-button color="primary" type="submit" [disabled]="loading || signupForm.invalid">Sign Up</button>
</form>
